import React from "react";
import '../../App.css';


const mockData = [
  { id: 1, container: "C1", slot: "S1", item: "Laptop", },
  { id: 2, container: "C1", slot: "S2", item: "Book", },
  { id: 3, container: "C2", slot: "S5", item: "Charger", },
  { id: 4, container: "C3", slot: "S9", item: "wifi box",  },
  { id: 5, container: "C3", slot: "S10", item: "Wire",  },
];

const DeviceTable = ({ searchTerm }) => {
  const filtered = mockData.filter((item) =>
    item.item.toLowerCase().includes(searchTerm.toLowerCase())
  );

  return (
    <div className="device-table">
      <h4>Device Management</h4>
      <table>
        <thead>
          <tr>
            <th>Sl. No</th>
            <th>Container</th>
            <th>Slot</th>
            <th>Item Name</th>
          </tr>
        </thead>
        <tbody>
          {filtered.map((d, i) => (
            <tr key={i}>
              <td>{i + 1}</td>
              <td>{d.container}</td>
              <td>{d.slot}</td>
              <td>{d.item}</td>
              
            </tr>
          ))}
        </tbody>
      </table>
      <p>Total Items: {filtered.length}</p>
    </div>
  );
};

export default DeviceTable;
